import React from 'react';
import './Login.css';

const DevLogin = () => {
  return (
    <div className="login-container">
      <h2 className="login-title">Welcome back, Developer!</h2>
      <h2 className="login-subtitle">Let's connect you to a job !</h2>
      <form className="login-form">
        <div className="form-group">
          <label htmlFor="email" className="login-label"><h3>Email :   </h3></label>
          <input type="email" id="email" placeholder="Email" className="login-input" required />
        </div>
        
        <div className="form-group">
          <label htmlFor="password" className="login-label"><h3>Password :</h3></label>
          <input type="password" id="password" placeholder="Password" className="login-input" required />
        </div>
        
        <div className="button-container">
          <button type="submit" className="login-button"><p></p>Log In</button>
        </div>
      </form>
    </div>
  );
}

export default DevLogin;
